description:
Practical advice from his new housekeeper helps Seth Webster, a widower with six-year-old twins, rebuild his life after the loss of his wife.

Losing a spouse is always hard, and for Seth Webster (James Van Der Beek), playing single dad to two rambunctious six-year-olds doesn't make it any easier. With the holidays approaching, finding a housekeeper has proven to be near-impossible, until Mrs. Emily Merkle (Doris Roberts) shows up at the Websters' door, ready to turn their lives around...

